":1}}],\"posts\":[],\"organized_events\":[{\"event_id\":20,\"event_name\":\"\\\"Building Solid Foundations for Future Champions in Skilled Professions!\\\"\",\"event_description\":\"The Olympics are designed to inspire and nurture practical skills in our students, setting them up for amazing careers. \\ud83d\\ude80 The day began with a burst of fun\\u2014a cheerful parade around the school with our talented students and enthusiastic TLE teachers! \\ud83c\\udfb6\\ud83d\\udeb6\\u200d\\u2640\\ufe0f\\ud83d\\udeb6\\u200d\\u2642\\ufe0f\\r\\nAnd the best part?  The launch also featured a thrilling cooking competition! \\ud83e\\uddd1\\u200d\\ud83c\\udf73\\ud83d\\udd25 Our incredible Grade 9 and 10 cookery students showcased their amazing culinary skills in the activity center, preparing, presenting, and serving their delicious creations to the judges. \\ud83c\\udf7d\\ufe0f\\ud83d\\ude0b It\'s been a fantastic success so far, and the Olympics wrap up tomorrow, July 13th.  We can\'t wait to see what happens next! \\ud83e\\udd29\\r\\nSo Siterians, get ready because this is just the beginning of a month full of learnings and wonderful events for the School-Based Skill Olympics 2025!  \\ud83e\\udd73\\ud83d\\udc4f\\ud83c\\udfc6  Let\'s make it a memorable one!\",\"club_id\":30,\"organizer_id\":8,\"event_date\":\"2025-07-12T16:00:00.000000Z\",\"event_time\":\"9am onwards\",\"event_location\":\"Sitero Francisco Memorial High School\",\"event_visibility\":\"CLUB_ONLY\",\"approval_status\":\"approved\",\"rejection_reason\":null,\"supporting_documents\":null,\"supporting_documents_original_name\":null,\"supporting_documents_mime_type\":null,\"supporting_documents_size\":null,\"approved_at\":\"2025-08-17T09:18:13.000000Z\",\"approved_by\":4,\"created_at\":\"2025-05-22T09:55:13.000000Z\",\"updated_at\":\"2025-08-17T09:18:13.000000Z\"},{\"event_id\":21,\"event_name\":\"Groove Siterians: The Ultimate Hip-Hop Dance Battle!\",\"event_description\":\"As part of Ani ng Sining: Diwa at Damdami