(108, 1, 'Admin User', 'ADMIN', 'user_management', 'created', 'Created new user account', '{\"route\":\"admin.users.details\",\"uri\":\"\\/admin\\/users\\/4\\/details\",\"method\":\"POST\",\"parameters\":{\"user\":{\"user_id\":4,\"role\":\"TEACHER\",\"status\":\"ACTIVE\",\"name\":\"Melody S. Delos Santos\",\"email\":\"melody@gmail.com\",\"sex\":null,\"address\":null,\"contact_no\":null,\"section_id\":null,\"mother_name\":null,\"mother_contact_no\":null,\"father_name\":null,\"father_contact_no\":null,\"profile_picture\":\"1743958684_4.jpg\",\"created_at\":\"2025-03-29T15:00:43.000000Z\",\"updated_at\":\"2025-05-22T18:06:14.000000Z\",\"advised_clubs\":[{\"club_id\":1,\"club_name\":\"Supreme Secondary Learner Government-Sitero Francisco MNHS\",\"club_adviser\":4,\"club_description\":\"The Supreme Secondary Learner Government (SSLG) - Sitero Francisco MNHS empowers student leaders to inspire positive change, advocate for the student body, and build a vibrant school community through leadership, service, and unity.\",\"category\":\"academic\",\"requires_approval\":1,\"club_logo\":\"club-logos\\/lFkL7res3cHWaPblBAg3VMDjmOROb6WAP5p1KTic.jpg\",\"club_banner\":\"club-banners\\/9aDbycENE7PPHR3Xy4RMq0c3b8salrOCdLpWPDDs.jpg\",\"created_at\":\"2025-03-29T15:02:34.000000Z\",\"updated_at\":\"2025-08-23T08:45:42.000000Z\",\"is_club_hunting_day\":1,\"memberships_count\":23}],\"section\":null,\"club_memberships\":[],\"posts\":[{\"post_id\":1,\"post_caption\":\"\\ud83d\\udce2 Greetings SSLG family!\\r\\nI am proud to witness the growth of our young leaders as they take initiative in planning our upcoming community outreach and student empowerment programs. Your passion and leadership truly shape a better school environment. Keep inspiring! \\ud83d\\udcaa\\r\\n#SFLG #StudentLeaders #ServeAndLead\",\"file_attachment\":null,\"file_original_name\":null,\"file_mime_type\":null,\"file_size\":null,\"club_id\":1,\"author_id\":4,\"post_visibility\":\"CLUB_ONLY\",\"post_date\":\"2025-05-19T01:4