(214, 1, 'Admin User', 'ADMIN', 'user_management', 'created', 'Created new user account', '{\"route\":\"admin.users.details\",\"uri\":\"\\/admin\\/users\\/2\\/details\",\"method\":\"POST\",\"parameters\":{\"user\":{\"user_id\":2,\"role\":\"TEACHER\",\"status\":\"ACTIVE\",\"name\":\"Jezelle Dalwampu\",\"email\":\"jezelle@gmail.com\",\"sex\":null,\"address\":null,\"contact_no\":null,\"section_id\":null,\"mother_name\":null,\"mother_contact_no\":null,\"father_name\":null,\"father_contact_no\":null,\"guardian_name\":null,\"guardian_contact_no\":null,\"profile_picture\":null,\"created_at\":\"2025-03-29T12:55:49.000000Z\",\"updated_at\":\"2025-05-22T08:10:35.000000Z\",\"advised_clubs\":[{\"club_id\":24,\"club_name\":\"CLICK - SFMNHS The English Club\",\"club_adviser\":2,\"club_description\":\"CLICK \\u2013 The English Club of Sitero Francisco MNHS is a vibrant community of learners who are passionate about mastering the English language through creative expression, critical thinking, and cultural appreciation. The club aims to enhance students\\u2019 communication skills in reading, writing, speaking, and listening while fostering confidence, creativity, and collaboration.\",\"category\":\"academic\",\"requires_approval\":1,\"club_logo\":\"club-logos\\/403fMhJyGlf4siqP7LrUjxh7mGv3i54caadj4TYs.png\",\"club_banner\":\"club-banners\\/7qfCuHbGOGg8KCRuzfWhE51Mr72goPql8cK51flz.jpg\",\"created_at\":\"2025-05-22T07:44:24.000000Z\",\"updated_at\":\"2025-08-10T12:28:36.000000Z\",\"is_club_hunting_day\":1,\"memberships_count\":1}],\"section\":null,\"club_memberships\":[],\"posts\":[{\"post_id\":18,\"post_caption\":\"Siterians, get ready to witness the Grade 10 students as they perform a powerful rendition of the piece \\\"1896\\\" by Aurelio S. Alvero on the elimination round of Conventional Speech Choir Competition this December 2, Monday, 10:30am at the SFMNHS Activity Center. Let us listen to their voices unite in harmony, bringing drama, rhythm and creativity to life. \\ud83d\\udde3\\ufe0f\\ud83d\\udde3\\ufe0f\",\"file_attachment\":null,\"file_original_name\":null,\"file_mime_type\":null,\"file_size\":null,\"club_id\":24,\"author_id\":2,\"post_visibility\":\"PUBLIC\",\"post_date\":\"2025-05-22T08:02:59.000000Z\",\"created_at\":\"2025-05-22T08:02:59.000000Z\",\"updated_at\":\"2025-05-22T08:02:59.000000Z\"}],\"organized_events\":[{\"event_id\":8,\"event_name\":\"Storytelling Contest\",\"event_description\":\"The STORYTELLING event is a celebration of creativity, expression, and the timeless art of telling tales. This event invites students from various grade levels to step into the spotlight and bring stories to life.\",\"club_id\":24,\"organizer_id\":2,\"event_date\":\"2025-05-22T16:00:00.000000Z\",\"event_time\":\"1:00 PM\",\"event_location\":\"SFMNHS AVR\",\"event_visibility\":\"CLUB_ONLY\",\"approval_status\":\"pending\",\"rejection_reason\":null,\"supporting_documents\":null,\"supporting_documents_original_name\":null,\"supporting_documents_mime_type\":null,\"supporting_documents_size\":null,\"approved_at\":null,\"approved_by\":null,\"created_at\":\"2025-05-22T07:56:50.000000Z\",\"updated_at\":\"2025-05-22T07:56:50.000000Z\"},{\"event_id\":9,\"event_name\":\"Poetry Unplugged: A Spoken Word Experience\",\"event_description\":\"Poetry Unplugged is an open mic-style spoken word event that gives students a platform to share their voices through original poems, dramatic monologues, and creative expressions.\",\"club_id\":24,\"organizer_id\":2,\"event_date\":\"2025-05-25T16:00:00.000000Z\",\"event_time\":\"10 am onwards\",\"event_location\":\"SFMNHS AVR\",\"event_visibility\":\"CLUB_ONLY\",\"approval_status\":\"pending\",\"rejection_reason\":null,\"supporting_documents\":null,\"supporting_documents_original_name\":null,\"supporting_documents_mime_type\":null,\"supporting_documents_size\":null,\"approved_at\":null,\"approved_by\":null,\"created_at\":\"2025-05-22T07:59:17.000000Z\",\"updated_at\":\"2025-05-22T07:59:45.000000Z\"},{\"event_id\":1