(1, 'Supreme Secondary Learner Government-Sitero Francisco MNHS', 4, 'The Supreme Secondary Learner Government (SSLG) - Sitero Francisco MNHS empowers student leaders to inspire positive change, advocate for the student body, and build a vibrant school community through leadership development, community service, and democratic governance.', 'academic', 1, 'club-logos/5YfyKtlbUUjKERR61fzjbp33fNZyIPbOHEZQqRB9.jpg', 'club-banners/HGRkZp6xUI2gPVe6ZyNsKTFInfoS2STjUozP9yR8.jpg', '2025-08-31 08:23:53', '2025-09-07 12:44:29', 1),
(3, 'Sitero SHS GILAS', 12, '\"To elevate integrity and Social Responsibilities of Society.\"', 'academic', 1, 'club-logos/SqqhdRiTn4aZHZRh2hDUriBIf90mrsBrb7h0MySc.jpg', 'club-banners/mGhxzLkmeHiQS8TZx5z8Wxc8Tkl5ddiPt1B2jPUV.jpg', '2025-03-30 06:29:57', '2025-08-31 11:49:33', 1),
(7, 'Sitero SHS SAMAFIL-Samahan ng mga Mag-aaral sa Filipino', 15, '\"Samahan ng mga Mag-aaral sa Filipino.\"', 'academic', 1, 'club-logos/RSlL7clxjxyRNvoXMo5YHHWrw5JFLuj2vgljrAzn.jpg', 'club-banners/lWgp51Kmmntt3edu50RssCqbf17ObnvGN6t7ckGZ.jpg', '2025-03-30 09:05:03', '2025-08-31 11:49:33', 1),
(8, 'Sitero Francisco Memorial National High School Guidance Office', 16, 'Mabuhay!\r\n\r\nTara sa Sitero Francisco Memorial National High School Virtual Guidance Center!\r\nDito walang iwanan, lahat tayo magtutulungan-- mag-aaral, guro, at magulang... Ano man ang sa inyong isip ay bumabagabag, sabihin lang, at ating pag-usapan...', 'academic', 1, 'club-logos/lLcROt8zOcdVgL6t4joVTHWIORvhuHDLLeobUZHp.jpg', 'club-banners/QtxTIDuxgMwiJWjSxLw0H4SKFdxPfyd9fV7qTdRH.jpg', '2025-03-30 09:07:21', '2025-08-31 11:49:33', 1),
(9, 'Altiora Peto/Ang Antipara', 17, 'Altiora Peto/Ang Antipara is the official social media outlet of the student publications in English and Filipino of Sitero Francisco Memorial National High School in Ugong, Valenzuela City.', 'academic', 1, 'club-logos/cuIenPBVJUBS2wL3ZRN5hrEf6hgp1RBUzw5ZOT5a.jpg', 'club-banners/PQRkWYesL6qpuReLr7xtbTF5IK3tJnf66FXVy7R1.png', '2025-03-30 09:12:37', '2025-08-31 11:49:33', 1),
(10, 'SFMNHS - Boy Scouts of the Philippines', 18, 'We encourage you to join the growing family of Siterian Scouts! Are you interested in fun adventures? Meeting new friends? Exploring the world? Well, you can do all of that when you join the Boy Scouts of the Philippines! \r\nSo what are you waiting for? Come and join our family now!', 'academic', 1, 'club-logos/LODcxMm3p6uUv0PCWENhuA7xswjZfMzyoXEOwwCO.jpg', 'club-banners/vXGOEQ7yol9B3yfVD6DY7MR2voGdkMXcjFKqql2d.jpg', '2025-03-30 09:16:57', '2025-08-31 11:49:33', 1),
(11, 'Sitero Youth Integrity Fighters', 19, 'Sitero Youth Integrity Fighters is a school-based organization since 2015 of CIC recognized by a sec.', 'academic', 1, 'club-logos/5GDTVMUu1WCPVwyzZHvveNfrTReZQU2FhwfUb2I3.jpg', 'club-banners/MGiZKBsrnbFhi0Kl7tIC98jRqGsv11d9ACb4ZyEy.jpg', '2025-03-30 09:23:05', '2025-08-31 11:49:33', 1),
