(19, 'Participation of Sitero Francisco MNHS - Senior High Theater Arts Guild of Enhancement (𝗦𝗧𝗔𝗚𝗘) in SK Ugong\'s Linggo ng Kabataan', '\"𝘼𝙣𝙜 𝙠𝙖𝙗𝙖𝙩𝙖𝙖𝙣 𝙖𝙣𝙜 𝙥𝙖𝙜-𝙖𝙨𝙖 𝙣𝙜 𝙗𝙖𝙮𝙖𝙣\"\r\n-Dr. Jose Rizal\r\nThe 𝑳𝒊𝒏𝒈𝒈𝒐 𝒏𝒈 𝒌𝒂𝒃𝒂𝒕𝒂𝒂𝒏 program celebrates the brilliance and passion of the youth, recognizing excellence in various fields and unwavering dedication as scholars of Ugong.🏅\r\nSection 30 of Republic Act No. 10742, the Sanggunian Kabataan Reform Act of 2015 mandates the observance of Linggo ng Kabataan in very barangay, municipality, city and province on the week where the 12th of August falls to coincide with the International Youth Day (IYD).', 29, 50, '2025-05-26', '8am onwards', '3S UGONG', 'CLUB_ONLY', 'approved', NULL, NULL, NULL, NULL, NULL, '2025-08-31 08:29:50', 4, '2025-05-22 09:45:49', '2025-08-31 08:29:50'),
(20, '\"Building Solid Foundations for Future Champions in Skilled Professions!\"', 'The Olympics are designed to inspire and nurture practical skills in our students, setting them up for amazing careers. 🚀 The day began with a burst of fun—a cheerful parade around the school with our talented students and enthusiastic TLE teachers! 🎶🚶‍♀️🚶‍♂️\r\nAnd the best part?  The launch also featured a thrilling cooking competition! 🧑‍🍳🔥 Our incredible Grade 9 and 10 cookery students showcased their amazing culinary skills in the activity center, preparing, presenting, and serving their delicious creations to the judges. 🍽️😋 It\'s been a fantastic success so far, and the Olympics wrap up tomorrow, July 13th.  We can\'t wait to see what happens next! 🤩\r\nSo Siterians, get ready because this is just the beginning of a month full of learnings and wonderful events for the School-Based Skill Olympics 2025!  🥳👏🏆  Let\'s make it a memorable one!', 30, 8, '2025-07-13', '9am onwards', 'Sitero Francisco Memorial High School', 'CLUB_ONLY', 'approved', NULL, NULL, NULL, NULL, NULL, '2025-08-17 09:18:13', 4, '2025-05-22 09:55:13', '2025-08-17 09:18:13'),
(21, 'Groove Siterians: The Ultimate Hip-Hop Dance Battle!', 'As part of Ani ng Sining: Diwa at Damdamin, we are thrilled to present the ultimate showdown for all Grade 10 students—Groove Siterians: The Ultimate Hip-Hop Dance Battle! 🏆🔥\r\nThis exciting event will be the highlight of your Grade 10 culminating activity, where you’ll have the chance to showcase your hip-hop skills, creativity, and passion for dance.\r\nSee you there!', 31, 8, '2025-09-02', '10 am onwards', 'Sitero Francisco Memorial High School', 'CLUB_ONLY', 'approved', NULL, NULL, NULL, NULL, NULL, '2025-08-17 09:16:11', 4, '2025-05-22 10:08:04', '2025-08-17 09:16:11'),
